description:
Children of Sanchez is the sixteenth overall album by jazz artist Chuck Mangione. It is also the soundtrack to the 1979 film Children of Sanchez. Chuck Mangione won a Grammy for Best Pop Instrumental Performance for the title song, &quot;Children of Sanchez&quot;. The title track is sung by Don Potter.


